// Checkout.jsx
import { useState, useEffect } from "react";
import axios from "axios";

export default function Checkout() {
  const [locations, setLocations] = useState([]);
  const [selectedWilaya, setSelectedWilaya] = useState("");
  const [communes, setCommunes] = useState([]);
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    phone: "",
    wilaya: "",
    commune: "",
    address: "",
    email: ""
  });

  // Load full JSON once
  useEffect(() => {
    axios
      .get(
        "https://raw.githubusercontent.com/AbderrahmeneDZ/Wilaya-Of-Algeria/master/Commune_Of_Algeria.json"
      )
      .then((res) => setLocations(res.data));
  }, []);

  // When a wilaya is selected, filter its communes
  useEffect(() => {
    if (selectedWilaya) {
      const wilayaObj = locations.find((w) => w.wilaya === selectedWilaya);
      setCommunes(wilayaObj ? wilayaObj.commune : []);
    } else setCommunes([]);
    setForm((prev) => ({ ...prev, commune: "" }));
  }, [selectedWilaya, locations]);

  function handleChange(e) {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
    if (name === "wilaya") setSelectedWilaya(value);
  }

  function handleSubmit(e) {
    e.preventDefault();
    console.log("Submit:", form);
    // TODO: send to backend
  }

  return (
    <form onSubmit={handleSubmit} className="checkout-form">
      <h1>Billing & Shipping</h1>

      <div className="field-grid">
        <div><label>First Name</label>
          <input name="firstName" value={form.firstName} onChange={handleChange} /></div>
        <div><label>Last Name</label>
          <input name="lastName" value={form.lastName} onChange={handleChange} /></div>
        <div><label>Phone *</label>
          <input name="phone" required value={form.phone} onChange={handleChange} /></div>

        <div><label>State / Wilaya *</label>
          <select name="wilaya" value={form.wilaya} required onChange={handleChange}>
            <option value="">Select State</option>
            {locations.map((w) => (
              <option key={w.wilaya} value={w.wilaya}>
                {w.wilaya} — {w.wilaya_ar}
              </option>
            ))}
          </select></div>

        <div><label>Town / Commune *</label>
          <select name="commune" value={form.commune} required onChange={handleChange}>
            <option value="">Select City</option>
            {communes.map((c) => (
              <option key={c.commune} value={c.commune}>
                {c.commune} — {c.commune_ar}
              </option>
            ))}
          </select></div>

        <div><label>Street address</label>
          <input name="address" value={form.address} onChange={handleChange} /></div>
        <div><label>Email</label>
          <input name="email" type="email" value={form.email} onChange={handleChange} /></div>
      </div>

      <div>
        <label>Order notes (optional)</label>
        <textarea name="notes" value={form.notes} onChange={handleChange} />
      </div>

      <button type="submit" className="place-order">
        Place Order
      </button>
    </form>
  );
}
